import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import LoginPage from './LogingPage'; // Make sure the path is correct
import Dashboard from './Dashboard';
import PatientRegistrationForm from './PatientRegistrationForm';
import Consultation from './Consultation';
import Laboratory from './Laboratory';
import FindPatient from './FindPatient'; // Case-sensitive match
import ProcessPayment from './ProcessPayment';  
import GiveDrugs from './GiveDrugs';






function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<LoginPage />} />
          <Route path="/sign in" element={<Dashboard />} />
          <Route path = "/Add patient" element = {<PatientRegistrationForm/>}/>
          <Route path='/Find Patient' element = {<FindPatient/>}/> 
          <Route path = "/Consultation" element = {<Consultation/>}/>
          <Route path ="/Laboratory" element = {<Laboratory/>}/>
          <Route Path = "/Process Payment" element ={<ProcessPayment/>}/>
          <Rout Path = "/Give Drugs" element = {<GiveDrugs/>}/>
          <Route path ='/'/>
        </Routes>




      </div>
    </Router>


  );
}

export default App;
